import React from "react";
import ActionPanel from "./components/ActionPanel";
import OutputPanel from "./components/OutputPanel";
import CodePanel from "./components/CodePanel";
import MessagePanel from "./components/messagePanel";
import { StateContextProvider } from "./context/StateContext";

const App = () => {
  return (
    <StateContextProvider>
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "20% 60% 20%",
          gridTemplateRows: "50% 50%",
          height: "100vh",
          gap: "5px",
          padding: "10px",
          boxSizing: "border-box",
        }}
      >
        {/* Action Panel (Left Column spanning 2 rows) */}
        <div
          style={{
            gridRow: "1 / span 2",
            border: "1px solid #ccc",
            borderRadius: "8px",
            padding: "10px",
            overflowY: "auto",
          }}
        >
          <ActionPanel />
        </div>

        {/* Output Panel (Middle Column spanning 2 rows) */}
        <div
          style={{
            gridRow: "1 / span 2",
            border: "1px solid #ccc",
            borderRadius: "8px",
            padding: "10px",
            overflowY: "auto",
          }}
        >
          <OutputPanel />
        </div>

        {/* Message Panel (Top Right) */}
        <div
          style={{
            border: "1px solid #ccc",
            borderRadius: "8px",
            padding: "10px",
            overflowY: "auto",
          }}
        >
          <MessagePanel />
        </div>

        {/* Code Panel (Bottom Right) */}
        <div
          style={{
            border: "1px solid #ccc",
            borderRadius: "8px",
            padding: "10px",
            overflowY: "auto",
          }}
        >
          <CodePanel />
        </div>
      </div>
    </StateContextProvider>
  );
};

export default App;
